import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        // Contenedor principal del Navbar con degradado, sombra y esquinas redondeadas
        <nav className="bg-gradient-to-r from-green-500 to-green-700 p-4 shadow-lg rounded-b-xl">
            {/* Contenedor centralizado para el contenido del Navbar */}
            <div className="container mx-auto flex justify-between items-center">
                {/* Nombre de la marca con fuente Comic Neue, m치s grande y con sombra de texto */}
                <div className="text-white text-3xl font-extrabold font-sans tracking-wide drop-shadow-md">
                    Bachue AI
                </div>

                {/* Contenedor de los enlaces de navegaci칩n */}
                <div>
                    {/* Enlace "Nosotros" con estilos mejorados y efecto de transici칩n */}
                    <Link
                        to="/"
                        className="text-white text-lg font-medium px-5 py-2 rounded-lg hover:bg-green-600 hover:text-white transition duration-300 ease-in-out mx-2"
                    >
                        Nosotros
                    </Link>
                    {/* Enlace "Empezar" con estilos mejorados y efecto de transici칩n */}
                    <Link
                        to="/inicio"
                        className="text-white text-lg font-medium px-5 py-2 rounded-lg hover:bg-green-600 hover:text-white transition duration-300 ease-in-out mx-2"
                    >
                        Empezar
                    </Link>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
